def get_unknotting_number(dowker_code):
    # create a list to store the count of each number in the dowker code
    counts = [0] * 25

    # loop through the dowker code and keep track of how many times we see each digit
    for i in range(len(dowker_code)):
        counts[int(dowker_code[i])] += 1

    # check if any digits occur more than once
    for j in range(25):
        if counts[j] > 1:
            return "The knot cannot be untied with this information."

    # calculate the unknotting number by summing up all the digits in the dowker code
    total = sum([counts[j]*2**j for j in range(25)])

    return "The unknotting number of the given knot is {}.".format(total)
